    [],nt"revision_timestamp": "2013-03-15T10:19:48.362775",nt"name": "accuracy-assessment-points-for-capitol-reef-national-park-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "This point file displays the 1,313 accuracy
    assessment (AA) points visited in the summer of 2005 as part of the vegetation mapping
    project. The points were randomly selected, stratified by the map units used for
    vegetation mapping and further screened so as not to fall on inaccessible isolated
    mesa tops or vertical canyon walls. The coordinates were uploaded to Trimble and
    Garmin hand-held GPS receivers so that ecologists could navigate to them in the
    field and the locations where data were collected were updated. Some AA points fell
    on ecotones and two sets of data were recorded on the evenly-split sites. AA points
    that fell along polygon edges sometimes did not represent the entire polygon well
    and some AA points fell on small patches of vegetation that were different than
    the community in the larger polygon. Field photos are associated with each plot.
    Only points within the NPS boundary were visited; the accuracy of the vegetation
    map outside the park boundary is untested.",nt"license_title": null,nt"extras":
